import React from 'react';
import './App.css';

function Projects() {
    return ( 
        <div>
           <Link to='https://github.com/Chittoji-Murali-Sree-Krishna' target='/projects'>
               <h1>My Github</h1>
           </Link>
         </div>
    );
}

export default Projects;
